def find_combinations(listOfTuples): 
    result = []
    def recurse(tuples, result): 
        for tup in tuples: 
            yield tup
            for i in range(len(tup)): 
                yield tuple([a,b]) 
                yield tuple([a,c]) 
                yield tuple([c,b]) 
                yield tuple([c,a])
