def  rgb_to_hsv(red, green, blue):
    min_value = min(red, green, blue)
    max_value = max(red, green, blue)
    hue = 0
    saturation = 0
    value = max_value
    if (min_value==max_value):
        hue = 0
    else:
        hue = (2 * (red - green)) / (max_value - min_value)
        if (red==min_value):
            saturation = 0
        elif (green==min_value):
            saturation = 100
        else:
            saturation = (2 * (red - green)) / (max_value - min_value)
    return (hue, saturation, value)
