def min_sum_path(graph): 
    stack = []
    current = []
    for node in graph: 
        value = node[0]
        if value < current[0]: 
            current.append(value)
        elif value == current[0]: 
            current.append(value)
            stack.append(current)
        else: 
            current = [value] + current
        stack.append(current)
    return sum(graph[stack[-1]][1])
